import { useState } from "react";

function InputForm(props) {
  const age = "";
  const name = "";
  let html = "";

  if (props.sendEntries.length == 0) {
    console.log("empty");
    html = <p>No Data Yet</p>;
  } else {
    console.log("Not Empty");
    html = <p>{props.sendEntries[0].name}</p>;
  }

  return <div>{html}</div>;
}

export default InputForm;
